import { Route, Switch, Redirect } from 'react-router-dom';

function App() {
  return (
    <Switch>
      <Route path='/' exact>
        <Redirect to='/meals' />
      </Route>
      <Route path='/' exact>
        <Redirect to='/meals' />
      </Route>
      <Route path='*' exact>
        <Redirect to='/meals' />
      </Route>
    </Switch>
  );
}

export default App;
